import React from'react';
function MovieCard(movie){
    return (
    <>
    Poster: movie.Poster,
    Title: movie.Title,
    Type: movie.Type,
    Year: movie.Year,
    imdbID: movie.imdbID
    </>
    )
};

export default MovieCard;
